diff.lhs:
.LegalTrademarks {
  background-color: '#f5f1ef';
  border-radius: 0;
  margin: 0 auto;
  min-height: 100%;
  padding: 1rem 1rem;
}
  @font-face {
  font-family: 'central_avenue_bold';
  src: url('central_avenue.otf') format('opentype'),
       url('central_avenue.woff2') format('woff2'),
       url('central_avenue.woff') format('woff');
  font-weight: normal;
  font-style: normal;
}

@media screen and (min-width: 769px) {
  .wrapper{
    margin: 9rem auto 2rem;
    max-width: 40rem;
    padding: 3rem 2.5rem 3rem 2.5rem;
    text-align: left;
    background-color: white;
  }
  h1{
  font-family:"central_avenue_bold", "sans-serif";
  font-size:48px;
  text-align: center;
  color:#f58426;

  }
  h2{
    font-family: "central_avenue_bold", "sans-serif";
    font-size:36px;
    text-align: center;

  }
  p{
    font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
    font-size:16px;
    margin: 1.5rem 1.5rem 1.5rem 1.5rem;

  }
  }
/* Mobile */
@media screen and (max-width: 768px) {
  .wrapper{
    margin: 3rem auto 0.2rem;
    max-width: 20rem;
    padding: 0.5rem 1.5rem 0.5rem 1.5rem;
    background-color: white;
    text-align: left;
  }

h1{
  font-family:"central_avenue_bold", "sans-serif";
  font-size:32px;
  text-align: center;
  color:#f58426;

  }
  h2{
    font-family: "central_avenue_bold", "sans-serif";
    font-size:24px;
    text-align: center;

}
p{
  font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
  font-size:12px;
  margin: 1.5rem 1.5rem 1.5rem 1.5rem;

}
}

